  namespace: Ubiquity.NET.Llvm.Values
  summary: Interface to an Attribute Dictionary
  remarks: >-
    <p>This interface provides a full collection of all the

    attributes keyed by the <xref href="Ubiquity.NET.Llvm.Values.FunctionAttributeIndex" data-throw-if-not-resolved="false"></xref>

    </p>

    <div class="NOTE"><h5>note</h5><p>This conceptually corresponds to the functionality of the

    LLVM AttributeSet class for Versions prior to 5. In LLVM 5 the

    equivalent type is currently AttributeList. In v5 AttributeSet

    has no index and is therefore more properly a set than in the

    past. To help remove confusion and satisfy .NET naming rules this

    is called a Dictionary as that reflects the use here and fits

    the direction of LLVM</p></div>
